import React from 'react';
import styles, { layout } from "../style";
const Directions = () =>{
return(
    <div className={`${layout.sectionReverse}  ${styles.boxWidth}`}>
    <div className={`${layout.sectionInfo} ${styles.flexCenter}`}>
      <button className={styles.heading2}>
       TEACHERS
      </button>
      <button className={styles.heading2}>
       STUDENTS
      </button>
      <button className={styles.heading2}>
       CLASSROOMS
      </button>

    </div>
  </div>
)
};
export default Directions;
